class Tasks extends Component {
  render() {
      const{task,tasks}=this.props
      console.log('task++++',tasks)
    return (
        <React.Fragment>
            {tasks.map((task)=>{
      <div name='Tasks' key={task.id} style={{height:'24px'}}>
        {task.content}
      </div>
            })
  }
      </React.Fragment>
    );
  }
}

export default Tasks;
